import React, { useState } from "react";
import axios from "axios";

function App() {
  const [file, setFile] = useState(null);
  const [transactions, setTransactions] = useState([]);
  const [analysisResult, setAnalysisResult] = useState(null);

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
  };

  const handleUpload = async () => {
    if (!file) {
      alert("Please select a file before uploading.");
      return;
    }
    try {
      const formData = new FormData();
      formData.append("file", file);

      const res = await axios.post("http://localhost:8000/upload-pdf", formData, {
        headers: { "Content-Type": "multipart/form-data" },
      });

      console.log("Server response:", res.data);
      if (res.data.transactions) {
        setTransactions(res.data.transactions);
      }
    } catch (error) {
      console.error(error);
      alert("Error uploading file.");
    }
  };

  const handleTransactionChange = (index, field, value) => {
    const updatedTransactions = [...transactions];
    updatedTransactions[index][field] = value;
    setTransactions(updatedTransactions);
  };

  const handleAnalyze = async () => {
    try {
      const res = await axios.post(
        "http://localhost:8000/analyze-transactions",
        transactions,
        {
          headers: { "Content-Type": "application/json" },
        }
      );
      setAnalysisResult(res.data.analysis);
    } catch (error) {
      console.error(error);
      alert("Error analyzing transactions.");
    }
  };

  return (
    <div className="p-4">
      <h1 className="text-xl font-bold mb-4">Loan Recommendation App</h1>

      {/* Upload PDF Section */}
      <div className="mb-4">
        <input type="file" accept=".pdf" onChange={handleFileChange} />
        <button onClick={handleUpload} className="bg-blue-600 text-white px-4 py-2 ml-2">
          Upload PDF
        </button>
      </div>

      {/* Display Transactions */}
      {transactions.length > 0 && (
        <div>
          <h2 className="text-lg font-bold mb-2">Parsed Transactions</h2>
          <table className="min-w-full table-auto border mb-4">
            <thead>
              <tr>
                <th className="border px-2 py-1">Date</th>
                <th className="border px-2 py-1">Description</th>
                <th className="border px-2 py-1">Credit</th>
                <th className="border px-2 py-1">Debit</th>
                <th className="border px-2 py-1">Balance</th>
              </tr>
            </thead>
            <tbody>
              {transactions.map((txn, idx) => (
                <tr key={idx}>
                  <td className="border px-2 py-1">
                    <input
                      type="text"
                      value={txn.date}
                      onChange={(e) =>
                        handleTransactionChange(idx, "date", e.target.value)
                      }
                      className="w-full"
                    />
                  </td>
                  <td className="border px-2 py-1">
                    <input
                      type="text"
                      value={txn.description}
                      onChange={(e) =>
                        handleTransactionChange(idx, "description", e.target.value)
                      }
                      className="w-full"
                    />
                  </td>
                  <td className="border px-2 py-1">
                    <input
                      type="number"
                      value={txn.credit}
                      onChange={(e) =>
                        handleTransactionChange(idx, "credit", parseFloat(e.target.value || 0))
                      }
                      className="w-full"
                    />
                  </td>
                  <td className="border px-2 py-1">
                    <input
                      type="number"
                      value={txn.debit}
                      onChange={(e) =>
                        handleTransactionChange(idx, "debit", parseFloat(e.target.value || 0))
                      }
                      className="w-full"
                    />
                  </td>
                  <td className="border px-2 py-1">
                    <input
                      type="number"
                      value={txn.balance}
                      onChange={(e) =>
                        handleTransactionChange(idx, "balance", parseFloat(e.target.value || 0))
                      }
                      className="w-full"
                    />
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
          <button onClick={handleAnalyze} className="bg-green-600 text-white px-4 py-2">
            Analyze Transactions
          </button>
        </div>
      )}

      {/* Display Analysis Result */}
      {analysisResult && (
        <div className="mt-4">
          <h2 className="text-lg font-bold mb-2">Analysis Result</h2>
          <p>Total Income: {analysisResult.total_income}</p>
          <p>Total Expenses: {analysisResult.total_expenses}</p>
          <p>Net Flow: {analysisResult.net_flow}</p>
          <p>Recommendation: {analysisResult.recommendation}</p>
        </div>
      )}
    </div>
  );
}

export default App;
